<script type="text/javascript">

// JS实现选项卡切换
window.onload = function() {
    //获取debug下的所有div
    var debug = document.getElementById("debug");
    var this7debug_logo = document.getElementById("this7debug_logo");
    var this7debug_close = document.getElementById("this7debug_close");
    var debug_divs = debug.getElementsByClassName("box");

    //获取menu下的所有li
    var debug_ul = document.getElementById("menu");
    var debug_lis = debug_ul.getElementsByTagName("a");

    //循环遍历信息
    for (var i = 0, len = debug_lis.length; i < len; i++) {
        debug_lis[i].index = i;
        debug_lis[i].onclick = function() {
            for (var j = 0; j < len; j++) {
                debug_lis[j].classList.remove("active");
                debug_divs[j].classList.remove("active");
                debug_divs[j].classList.remove("hide");
                debug_divs[j].classList.add("hide");
            }
            this.classList.add("active");
            debug_divs[this.index].classList.remove("hide");
            debug_divs[this.index].classList.add("active");
        }
    }

    this7debug_logo.onclick = function(){
        debug.style.display= "block";
        this7debug_logo.style.display= "none";
    }
    this7debug_close.onclick = function(){
        debug.style.display= "none";
        this7debug_logo.style.display= "block";
    }
}
</script>